function parseVesselDateTime(data){
  while(data.length > 0){
    var parts = data.shift().split(/,/);
    if(parts[0].startsWith("<<<")){
      var vessel = parts[0].replace(/^<<<\s*/,"");
      var date = parts[1];
      var time = parts[2].replace(/\s.*$/,"");
      var dateparts = date.split("/");
      var timestamp = dateparts[2]+"-"+dateparts[0]+"-"+dateparts[1]+"T"+time+"Z";
      vessel = vessel.replace(/([a-z](?=[A-Z]))/g, '$1 ');
      vessel = vessel.charAt(0).toUpperCase() + vessel.slice(1);
      return {
        vessel: vessel,
        date: date,
        time: time,
        timestamp: timestamp
      };
    }
  }
  return null;
}
function trim1(s){
  return s.substring(1,s.length - 2);
}
function removeEmptyLeader(parts){
  if(parts[0] == ""){
    parts.shift();
  }
  return parts;
}
function parseHeaders(data){
  if(data.length && data[0].match(/^<.*batos.*>$/i)){
    var headers = trim1(data.shift()).split(/,/);
    return removeEmptyLeader(headers);
  }
  return null;
}
function parseUnitInfo(data){
  if(data.length && data[0].match(/^<.*degrees.*>$/i)){
    var unitInfo = trim1(data.shift()).split(/,/);
    return removeEmptyLeader(unitInfo);
  }
}
