var NMEA_SENTENCE_NFIELDS = { AAM: 6, ALM: 17, APA: 11, APB: 14, BOD: 7,
  BWC: 14, BWR: 13, BWW: 7, DBK: 7, DBS: 7, DBT: 7, DBN: 17, DBT: 3,
  DTM: 9, FSI: 5, GBS: 9, GGA: 15, GLC: 14, GLL: 8, GNS: 13, GRS: 15,
  GST: 9, GSA: 18, GSV: undefined, GTD: 6, GXA: 8, HDG: 6, HDM: 3,
  HDT: 3, HFB: 5, HSC: 5, ITS: 3, LCD: 14, MSK: 6, MSS: 6, MTW: 3,
  MWV: 5, OLN: 4, OSD: 10, R00: undefined, RMA: 12, RMB: 15, RMC: 13,
  ROT: 3, RPM: 6, RSA: 5, RSD: 14, RTE: undefined, SFI: undefined,
  STN: 2, TDS: 3, TFI: 4, TPC: 7, TRP: 7, TPT: 7, TRF: 13, TTM: 14,
  VBW: undefined, VDR: 7, VHW: 9, VLW: 5, VPW: 5, VTG: 10, VWR: 9, WCV: 4,
  WNC: 7, WPL: 6, XDR: undefined, XTE: 7,  XTR: 4, ZDA: 7, ZFO: 4,
  ZTG: 4
};
function parseData(data){
  if(data.length == 0 || !data[0].match(/^<.*>$/)) return null;
  var arr = removeEmptyLeader(trim1(data.shift()).split(/,/));
  var result = [];
  while(arr.length){
    var v = arr.shift();
    if(!v.match(/^\$[A-Z0-9]{5}$/)){
      result.push(v);
      continue;
    }
    // NMEA message.
    var nmea_key = v.substring(3);
    var n = NMEA_SENTENCE_NFIELDS[nmea_key];
    var parts = [v];
    if(n){
      for(var i=0;i<n-1;i++){
        parts.push(arr.shift());
      }
    }else{
      // just find the checksum field
      while(arr.length){
        var f = arr.shift();
        parts.push(f);
        if(f.match(/.+\*[0-9A-F]+$/)) break;
      }
    }
    result.push(parts.join(","));
  }

  return result.map(x=>x.trim().match(/^[0-9]+(\.[0-9]+){0,1}$/)?parseFloat(x.trim()):x);
}

var parseShipData = function(body){
  var lines = body.split(/\r?\n/);
  var vdt = parseVesselDateTime(lines);
  var headers = parseHeaders(lines);
  var unitInfo = parseUnitInfo(lines);
  var data = parseData(lines);
  if(data.length != headers.length){
    throw("mismatched length of data vs. headers");
  }
  for(var i=0;i<headers.length;i++){
    vdt[headers[i]] = data[i];
  }
  var t = {};
  if(vdt["Seapath Latitude"] !== undefined && vdt["Seapath Longitude"] !== undefined){
    var degrees = parseFloat(vdt["Seapath Latitude"].substring(0,2));
    var minutes = parseFloat(vdt["Seapath Latitude"].substring(2,vdt["Seapath Latitude"].length - 1));
    var direction = vdt["Seapath Latitude"].substring(vdt["Seapath Latitude"].length-1);
    var latitude = (degrees + minutes/60.0) * (direction == 'N' ? 1.0: -1.0);
    degrees = parseFloat(vdt["Seapath Longitude"].substring(0,3));
    minutes = parseFloat(vdt["Seapath Longitude"].substring(3,vdt["Seapath Longitude"].length - 1));
    direction = vdt["Seapath Longitude"].substring(vdt["Seapath Longitude"].length-1);
    var longitude = (degrees + minutes/60.0) * (direction == 'W' ? -1.0: 1.0);
    t.latitude = latitude;
    t.longitude = longitude;
  }
  t.vessel = vdt.vessel;
  t.humidity = vdt["BATOS Humidity Value"];
  t.air_pressure = vdt["BATOS-Air Pressure"];
  t.air_temp = vdt["BATOS-Air Temp Value"];
  t.hull_temp = vdt["Batos Hull Temperature Value"];
  t.wind_dir = vdt["Batos-Wind Dir"];
  t.wind_dir_type = vdt["Batos-Wind Dir Type"];
  t.wind_speed = vdt["Batos-Wind Spd"];
  t.depth = vdt["Depth Meters from Surface"];
  t.fluorescence = vdt["Fluorescence value"];
  t.ext_water_temp = vdt["SBE21 External Water Temp"];
  t.int_water_temp = vdt["SBE21 Int Water Temp"];
  t.salinity = vdt["SBE21 Water Salinity"];
  t.time = vdt.timestamp;
  return t;
}

